import React from 'react';

const Services = () => {
  return (
    <div>
      <h1>Our Services</h1>
      <ul>
        <li>Pool Installation</li>
        <li>Maintenance and Cleaning</li>
        <li>Custom Pool Designs</li>
      </ul>
    </div>
  );
};

export default Services;
